#include<bits/stdc++.h>
using namespace std;const int MAXN=300;bitset<MAXN>L[MAXN][MAXN],R[MAXN][MAXN];typedef long long LL;struct Point{LL x,y;Point(int a_=0,int b_=0):x(a),y(b){}Point operator-(const Point&b){return Point(x-b.x,y-b.y);}};LL operator^(const Point&a,const Point&b){return a.x*b.y-a.y*b.x;}LL operator*(const Point&a,const Point&b){return a.x*b.x+a.y*b.y;}vector<Point>w,b;void Rename(vector<string>a,vector<int>&b){b.clear();int v=0;for(int i=0;i<a.size();i++)for(int j=0;j<a[i].length();j++){if(a[i][j]>='0'&&a[i][j]<='9')v=v*10+a[i][j]-'0';else{if(v)b.push_back(v);v=0;}}if(v)b.push_back(v);}class CheckerFreeness{public:string isFree(vector<string>whiteX,vector<string>whiteY,vector<string>blackX,vector<string>blackY){vector<int>wx,wy,bx,by;Rename(whiteX,wx),Rename(whiteY,wy),Rename(blackX,bx),Rename(blackY,by);w.clear(),b.clear();for(int i=0;i<wx.size();i++)w.push_back(Point(wx[i],wy[i]));for(int i=0;i<bx.size();i++)b.push_back(Point(bx[i],by[i]));for(int i=0;i<b.size();i++)for(int j=0;j<b.size();j++)if(i!=j)for(int x=0;x<w.size();x++)if(((w[x]-b[i])^(b[j]-b[i]))>=0)R[x][i][j]=1;else L[x][i][j]=1;for(int i=0;i<w.size();i++)for(int j=i+1;j<w.size();j++){bitset<MAXN>up;up.reset();for(int k=0;k<b.size();k++)if(((b[k]-w[i])^(w[j]-w[i]))<0)up[k]=1;for(int k=0;k<b.size();k++)if(((b[k]-w[i])^(w[j]-w[i]))>0)if((up&L[i][k]&R[j][k]).count())return"NO";}return"YES";}};
